import Layout from "../components/layout";
import Head from "next/head";
import ProdcutBox from "../components/product-box/product-box";
import {useSelector, useDispatch} from "react-redux";
import { addCartAction } from "../redux/actions/cartAction";

export default function Product(){

  const dispatch = useDispatch();

  //const state = useSelector(state => state.cart);


  console.log(state)




  const handleAddCart = ()=>{
    dispatch(addCartAction({productName: "ramo"}))
  }

  return (
    <Layout>
      <Head>
        <title>Products</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        gridGap:"20px",
        marginTop:"20px"
      }}>
      <ProdcutBox onClick={handleAddCart} productName="Product 1"/>
      <ProdcutBox productName="Product 2"/>
      <ProdcutBox productName="Product 3"/>
      <ProdcutBox productName="Product 4"/>
      </div>
    </Layout>
  )
}
